import java.util.Stack;

public class Day05 {

    public static void main(String[] args) {
        String input = "";
        String testInput = "dabAcCaCBAcCcaDA";


        System.out.println("Size of polymer: " + calculateReactingPolymerPART1(input));

        findShortestPolymerWithoutSpecificUnitPART2(input);
    }

    private static int calculateReactingPolymerPART1(String input) {
        Stack<Character> characterInputStack = new Stack<Character>();
        int counter = 0;

        for (Character character : input.toCharArray()) {
            if (!characterInputStack.empty() && Math.abs(character - characterInputStack.peek()) == 32) {

//                System.out.println("Current character: " + character);
//                System.out.println("Stack character: " + characterInputStack.peek());
//                System.out.println("-------------------------------------------");
                counter++;
                characterInputStack.pop();
            } else {
                characterInputStack.push(character);
            }
        }
//        System.out.println("Number of reactions: " + counter);

        return characterInputStack.size();
    }

    public static void findShortestPolymerWithoutSpecificUnitPART2(String input){
        char letterA = 'a';
        char letterZ = 'z';

        for(int letter = letterA; letter<=letterZ; letter++) {
            String output = input.replace(String.valueOf((char) letter), "");
            char capitalLetter = (char) (letter-32);
            output = output.replace(String.valueOf(capitalLetter), "");
            System.out.println("Polymer size without letter " + (char) letter + ": " + calculateReactingPolymerPART1(output));
        }
    }
}
